      }, 1500)
    })

    const toolbarConfig = {}
    const editorConfig = {MENU_CONF: {}}
    editorConfig.MENU_CONF['uploadImage'] = {
      timeout: 5 * 1000, // 5s

      fieldName: "image",
      headers: {
        "Content-Type": "multipart/form-data",
