      },
      maxFileSize: 10 * 1024 * 1024, // 10M

      base64LimitSize: 5 * 1024, // 5kb 以下插入 base64
      onBeforeUpload(files) {
        return files; // 返回哪些文件可以上传
        // return false 会阻止上传
      },
      onProgress(progress) {
        console.log("onProgress", progress);
      },
      onSuccess(file, res) {
        console.log("onSuccess", file, res);
      },
      onFailed(file, res) {
        alert(res.message);
        console.log("onFailed", file, res);
      },
      onError(file, err, res) {
        alert(err.message);
        console.error("onError", file, err, res);
      },

      // 用户自定义上传图片
      customUpload(file, insertFn) {
        var axios = require("axios");
        var FormData = require("form-data");
        var data = new FormData();
        data.append("file", file); // file 即选中的文件
        axios.post("/api/upload//setImg",data).then(e=>{
          let url=e.data.data.url
          insertFn(url, "使用说明", url)
        })
          // console.log(e)
        }
      //   var config = {
      //     method: "post",
      //     url: "/api/upload/setImg", //上传图片地址
      //     headers: {
      //       "Content-Type": "multipart/form-data",
      //       Authorization: "Cookie " + localStorage.getItem("cookie")
      //     },
      //     data: data
      //   };
      //
      //   axios(config)
      //       .then(function (res) {
      //         let url =  res.data.data.path; //拼接成可浏览的图片地址
      //         insertFn(url, "使用说明", url); //插入图片
      //       })
      //       .catch(function (error) {
      //         console.log(error);
      //       });
      // }

    }

    // 组件销毁时，也及时销毁编辑器
    onBeforeUnmount(() => {
      const editor = editorRef.value
      if (editor == null) return
      editor.destroy()
    })

    const handleCreated = (editor) => {
      editorRef.value = editor // 记录 editor 实例，重要！
    }

    return {
      editorRef,
      valueHtml,
      mode: 'default', // 或 'simple'
      toolbarConfig,
      editorConfig,
      handleCreated
